import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import { authRoutes } from "../routes";

const AppRouter = () => {
  const isAuth = false;
  return;
  <Routes>
    {isAuth &&
      authRoutes.map(({ path, component }) => (
        <Route key={path} path={path} element={component} />
      ))}
  </Routes>;
};

export default AppRouter;
